INSERT INTO `news` (`id`, `title`, `body`, `author_id`) VALUES
(2, 'Арестован создатель приложения для обхода блокировки «вКонтакте»', 'Федор Власов, создавший приложение Kate Mobile для обхода блокировки социальной сети «вКонтакте», арестован по подозрению в причастности к незаконным действиям. 23 ноября об этом сообщили в сообществе приложения Kate Mobile во «вКонтакте».\r\n\r\nВ сообществе отметили, что причиной задержания стали незаконные действия посторонних личностей, использовавших прокси-сервера приложения. В связи с этим в Kate Mobile приостановили работу сервиса.\r\n\r\nKate Mobile является приложением для Android-телефонов, через которое можно зайти в социальную сеть в обход блокировки. Этим приложением активно пользуются жители Украины, сейчас в сообществе Kate Mobile состоит 5,8 млн участников.\r\n\r\nНапомним, в мае 2017 года на Украине решением президента Петра Порошенко был заблокирован ряд российских интернет-сервисов, включая социальную сеть «вКонтакте».', 2),
(3, 'Осуждающие лица на сигаретных пачках помогут бросить курить', 'Изображения людей, испытывающих отвращение и осуждение, на сигаретных пачках подтолкнули участников небольшого эксперимента к желанию бросить курить — таким образом, для борьбы с курением можно использовать не только запугивающие медицинские иллюстрации, но и отсылки к его стигматизации.  К такому выводу пришли авторы статьи, опубликованной в журнале Journal of Consumer Affairs.\r\n\r\nДженнифер Джеффри (Jennifer Jeffrey) и Мэттью Томсон (Matthew Thomson) из Западного университета в Канаде отмечают, что обычно для борьбы с курением, которое они называют «международным кризисом здравоохранения», используются изображения поврежденных органов курильщиков на пачках и другие сообщения, призванные напугать потребителя сигарет. Они решили проверить, можно ли использовать для этой цели общественное отвращение к курению и его осуждение, надавив таким образом на самооценку курильщика.\r\n\r\nДля этого они поставили онлайн-эксперимент с участием 156 курильщиков из США, которым случайным образом показывали сигаретные пачки со слоганом «Так люди смотрят на курильщиков» и одной из двух черно-белых картинок: на одной фотографии выражение лиц у трех человек было нейтральным, на другой отчетливо читалось отвращение. Добровольцам предлагали оценить, насколько такая пачка заставляет их чувствовать себя виноватыми, испытывать стыд, сожаление и унижение, и насколько она подталкивает их курить меньше или вовсе отказаться от этой привычки.', 3),
(4, 'Наталья Орейро сняла новый клип в подмосковной Балашихе', 'Наталья Орейро на несколько дней прилетала в Россию и даже спела часть песни на русском (а еще - на испанском и английском). Причем в тексте куплета она называет себя просто Наташей.\r\n\r\nРади съемок оператор и режиссер прогулялись по Балашихе, сняли несколько общих планов домов, зашли в несколько квартир, где на стенах оказались портреты певицы. А потом облюбовали одну комнату - типичную для средней полосы России: с ковром на стене и простой, но уютной обстановкой. Именно в ней и снимали часть клипа To Russia With Love (\"К России с любовью\"). А в съемках, которые проходили уже в местном Дворце культуры и на улицах, охотно участвовали и жители Балашихи.\r\n\r\nВ итоге Наталья Орейро показала в клипе атмосферу праздника, который можно создавать в любой обстановке: были бы желание, хорошие люди рядом да и бодрая, зажигательная музыка… А в припеве певица даже пропела-прокричала: \"Я люблю тебя Россия, пойте со мной, улыбайся!\"\r\n\r\nВ финале уже прозвучало и поздравление с Новым Годом. Сингл и видео To Russia With Love по мнению Натальи-Наташи как раз предназначены и для этого праздника!', 1),
(5, 'Подсчитан весь свет во Вселенной', 'Ученые Университета Клемсона (США) подсчитали количество света, который был излучен за всю историю существования наблюдаемой Вселенной.\r\n\r\nПо словам астрофизика Марко Аджелло (Marco Ajello), ведущего автора исследования, общее количество испущенных фотонов составляет 4 на 10 в 84-й степени. Кроме того, ученым удалось установить, что около 11 миллиардов лет назад интенсивность звездообразования достигла своего пика.\r\n\r\nВозраст Вселенной достигает 13,5 миллиарда лет. Наблюдаемой Вселенной, или Метагалактикой, называют ту область пространства, из которой свет за все время существования космоса успел достичь Земли. Границей Метагалактики является космологический горизонт, за которым объекты из-за расширения Вселенной удаляются настолько быстро от Земли, что их свет никогда не достигнет Земли. Для земных астрономов границей Метагалактики является реликтовое излучение — самый удаленный наблюдаемый объект.\r\n\r\nПо подсчетам космологов, в Метагалактике находится около триллиона галактик. Ученые проанализировали данные о гамма-излучении 739 активных галактик, полученные космическим телескопом Ферми, и определили количество фотонов, из которых состоит внегалактический фоновый свет. Последний представляет собой свет в ультрафиолетовой, видимой и инфракрасной области спектра, который был излучен всеми галактиками за всю историю существования Метагалактики. Фоновый свет мешает распространению гамма-лучей через фотон-фотонные взаимодействия, что влияет на спектр-излучения гамма-источников.', 4),
(6, 'Буйный слон загнал людей на крыши и остановил поезд', 'В индийском штате Одиша (Орисса) в деревню ворвался дикий слон.\r\n\r\nМолодой самец промчался по улицам, нападая на людей, ломая вещи и круша оставленные у домов мотороллеры и велосипеды. Жителям пришлось спасаться от разъяренного животного на крышах. Во время бегства три человека получили легкие травмы.\r\n\r\nЗатем слон вышел на железнодорожные пути и преградил путь составу. В результате отправление нескольких поездов было задержано. После этого животное добровольно покинуло населенный пункт и ушло в лес.\r\n\r\nВ 2017 году сообщалось, что стадо голодных слонов оккупировало деревню в китайской провинции Юньнань. При виде ищущих пропитание животных местные жители заперли двери и забрались на крыши. Слоны бродили по местности всю ночь.', 5);

